import article1 from '../img/Articles/ocgBali.jpg';
import article2 from '../img/Articles/eolienne.jpg';
import article3 from '../img/Articles/burger.jpg';

class Articles extends Component {

    constructor() {
      super();
      this.state = {
        composts: []
      };
    }

    componentDidMount() {
      fetch('http://127.0.0.1:8000/compost')
        .then(response => response.json())
        .then(data => this.setState({ composts: data }));
    }

    render() {
      return (
        <div class="container">
                <div class="row">
                    <div class="col-md-4 col-12 col-lg-4">
                        <div class="card">
                            <img class="card-img-top" src={ article1 } alt="Card image cap" />
                            <div class="card-body">
                                <h5 class="card-title">Card title</h5>
                                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                <a href="#" class="btn btn-outline-dark">Voir</a>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4 col-12 col-lg-4">
                    <div class="card">
                            <img class="card-img-top" src={ article2 } alt="Card image cap" />
                            <div class="card-body">
                                <h5 class="card-title">Card title</h5>
                                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                <a href="#" class="btn btn-outline-dark">Voir</a>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4 col-12 col-lg-4">
                    <div class="card">
                            <img class="card-img-top" src={ article3 } alt="Card image cap" />
                            <div class="card-body">
                                <h5 class="card-title">Card title</h5>
                                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                <a href="#" class="btn btn-outline-dark">Voir</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
      );
    }
    }
    export default Articles;
